import { useRouter } from "next/router";
import Link from "next/link";
import { useEffect, useState } from "react";
import fetch from "isomorphic-unfetch";
import myKeys from "../../myKeys.json";

const Result = (props) => {
  if (!props.brandOwner || !props.ingredients) {
    return null;
  }
  return <div></div>;
};

const FoodDetailsPage = () => {
  const router = useRouter();
  const fdcId = router.query.id;
  const [foodDetails, setFoodDetails] = useState(null);
  let brandOwner, ingredients;
  useEffect(() => {
    const fetchData = async () => {
      const response = await fetch(
        `https://api.nal.usda.gov/fdc/v1/food/${fdcId}?api_key=${myKeys.usda}`
      );
      const jsonData = await response.json();
      setFoodDetails(jsonData);
    };

    fetchData();
  }, [fdcId]);

  //({ brandOwner="", ingredients="" } = foodDetails);

  // if(foodDetails){
  //   console.log("fooddetails: ", foodDetails);
  //   ({ brandOwner, ingredients } = foodDetails);
  //   console.log("length: ", brandOwner.length);
  // }

  return (
    <div>
      <Link href="/">
        <a>Back</a>
      </Link>
      {brandOwner.length > 0 && (
        <div>
          <h3>Brand: {brandOwner}</h3>
          <h3>ingredients: {ingredients}</h3>
        </div>
      )}
    </div>
  );
};

export default FoodDetailsPage;
